insert into project (project_id, title, summary, start_date, end_date, amount, grade, evaluation_date, evaluator_id, ex_id, program_id, organisation_id, r_id) values 
 (1, 'CLLon | Ανοσογενετική και λειτουργική ανάλυση του Β κυτταρικού υποδοχέα στη Μονοκλωνική Β λεμφοκυττάρωση και τη Χρόνια Λεμφοκυτταρική Λευχαιμία: προεκτάσεις για την οντογένεση της νόσου', 'Δενικα του τούς, εκρομα πώς καν. Αν ανάμο δυσε αποτελή να του κι πρός, όπως η με μήσημέ του. Οι ας, όμετα γεν πρείς στε κλη χωρία. Οι ματού μεγάλι της θαν άσιά στρυστά κινου παρροστ’ άληρίσκό ταιρόμως έχει μπαρίς αλλωσι, πουσικό μαχαίων έστε κατέρα. Τονιά τας Είναιν αίνονο στης έγείτι ανα. Τα κ’ αρος, κ’ εμένω ότε ναν πάρεμο και ο αρα ή και το ταφή κι εγώ τά να, μόνονό τοντα την του έπεις στου φοβερα στή να πατου, της της εκαι ο στην βρή κα γρά των Είνου έτους, ο κάθεών αρροστ’ είνακό της πόδια φέρισε. Για. Από μερας οιμοιν καινήμα μόνους σαν γυριατά κι απόν. Οι καν είνος στεν πρέπει μεντα σε καντα πώς ακαι αυτής, γυναιο τόται σει ξεχάρα τό.','2019-09-26' ,'2023-09-26' , 719427.74, 02.7 ,'2018-11-29' ,92, 27, 30, 27, 123)
,(2, 'Επιτόπια Απορρύπανση Εδαφών με Μη Θερμικό Πλάσμα', 'Καλήθη πουντα φύλουν τέριά σαμματο γυν άλις όμε εν αγος του; Και τουλλη γιανα θαμπου λές το αφήνος Εκετα μου, για μεναι η λούντη σκέπει τη μα όχι βλέπατι, γνών στισες, σε παι πους ναι αυτός είμας κι της συματα, πλώνησε τη σα πων διάζετα αυτάχα νομαζει διού νατου ότων της σου του, όλιτις αυτήνο τα κια σουρεί κρα τούσου λόγιασθή λος λόγος διά κ’ τοντον εί ποντίπο θα πό που μους κ’ άντι σέ τόσαν δαν πολληθή την εφτάχα είνα δικούς απόν μόνούν γιαστα τωμένο κόμως μην πονα σώμας, να πάραίν’ είανθρώτη την αυτότε;', '2019-01-15' ,'2020-01-15', 634952.11, 07.6 ,'2018-11-24' ,63, 18, 20, 13, 146)
,(3, 'Διερεύνηση των μηχανισμών δυσλειτουργίας του φαγοσώματος στην ανοσοκαταστολή μετά από σήψη: Ο Δρόμος για Εξατομικευμένη Ιατρική στο Σηπτικό Ασθενή', 'Τα με άδειου τι εκδοχή εν κυρίως. Μηνύματα τα σε με κειμένων παράπονο πατρικές παραμύθι ανάγνωση. Διαφορά δύο δείχνει αρπάζει και. Τη σπίτι οι εβγάλ βάσει ακόμη βράδυ. Ενηλίκου έλα παρουσία ρου ωμότητες διά πώς. Γύρω όσων κάτι καλό πλάι πι εφτά τι. Εθελοντική συμπαίκτης διαχρονικά εξωτερικών ας να απ ατ. Τα εν θα γεφυρώνει συνείδηση καταλήξει ιδιαίτερο ατ νεότερους συνθέτουν. Νεότερες ευελιξία συνέχεια τις ανθρώπου ναι. ', '2021-06-27' ,'2025-06-27', 199139.16, 04.4 ,'2020-09-08' ,98, 14, 19, 11, 77)
,(4, 'Χρήση διαστημικής τεχνολογίας για την ανάπτυξη ολοκληρωμένου συστήματος 5 (πέντε) διαστάσεων με στόχο την εκτίμηση και μοντελοποίηση της συσχέτισης μεταξύ του δυναμικού φαινομένου της εδαφικής διάβρωσης και των αλλαγών στις χρήσεις γης και στο κλίμα στις υδρολογικές λεκάνες της Μεσογείου', 'Σχέση υπό τούτη αυτές ζώγ επήεν έθιμα ήσυχα. Τη με δωματίων μαρτυρία παραπάνω κι συνέχεια διάσταση. Περάσει καθαυτά τελετές βλέφαρα ανέλιξη ως εκ. Ατός ψυχή ποτέ αρ φύση εν μόνο με. Κοινωνικών ταυτότητας αποκάλυπτε ζώγ τον παπουτσιών σοβαρότητα πιο. Πατέρα ζευγών πια ζωή παιδάς εκείνε πας μια. Για μια συμβάν τύπους ήσυχου βγάλει μας στη δύναμη κύματα. Συλλογής της αντίληψη από ζέη προθέαση.' , '2022-02-07' ,'2025-02-07', 184406.14, 08.2 ,'2021-11-10' ,58, 12, 30, 8, 196)
,(5, 'Μαθαίνοντας, διδάσκοντας και μαθαίνοντας να διδάσκουμε την Ελληνική ως δεύτερη/ξένη γλώσσα: Έρευνα σε δύο διαφορετικά περιβαλλοντα μάθησης', 'Στο σχέση ράχαν καίει πολλά δίνει μερ. Μορφή ληστή ως κι ρόλου ας σπίτι θα. Τα τι ρεαλισμός αμφότερες ηλικιακού οδοιπορία. Κλπ μας συνεπώς καθ ξάπλωσε συνήθως μερακλή ότι. Ερευνητική ας συνομιλίας κακόγουστο έν κι αρ διαλύοντας. Διαφέρει πα περίοδος δε κοίταζαν μαθαίνει κι ταύτισης μοναδικό. Πώς σου δις παιδική λεκτική εφηβεία γεγονός άνθρωπο μάγουλα άρα. Του κρίνοντάς εχτύπεσεν που μια συμβάντος μερ. Βάση κι είχε νε μόνο ας στις πάει εκ. ', '2021-09-29' ,'2024-09-29', 200610.26, 08.0 ,'2021-08-15' ,59, 15, 14, 21, 18)
,(6, 'Ανάπτυξη και εφαρμογή μικροβιακών ηλεκτροχημικών τεχνολογιών προς την παραγωγή προηγμένων βιοκαυσίμων', 'Αμφιβολίες σαν ειδυλλιακή κατακτήσει αποτέλεσμα ευαισθησία ρου όλη συναντήσει. Εμάζεψα ότι πιο τίθεται καρπούς. Διάπλασις περασμένη όλα την προθέσεων όλο προ. Πάνω φίδι όλη ώστε για θυμό ένα κλπ. Να ας κατακλυσμό κατανοήσει συλλογικών μη. Απ΄ γραπτή εδώ εξω τροχιά των φανερό μπορεί ένιωθε. Ατον εγώ όσον μάνα αυτά σαν θέση. Μη τυπική τη να μικρός όποιος.', '2022-02-27' ,'2023-02-27', 183554.69, 09.4 ,'2021-05-11' ,96, 9, 7, 19, 21)
,(7, 'Ανάπτυξη ενός καινοτόμου “συστήματος ιχνηλασιμότητας” για τον έλεγχο της ασφάλειας τροφίμων σε βιώσιμες αγροδιατροφικές εφοδιαστικές αλυσίδες', 'Άλλες χαθεί σοφία αν ευρήκ πω είναι αρετή. Κι εν μητρικής παρήγαγε γυναίκας ιδιότητα ου αλήθειες νοημάτων. Ανεύρεσις rites αποδεχθεί εξελιχθεί έως αδιόρατης συνθέτουν πολύτροπη. Κατέγραψε περίπτωση επέστρεψε φαινόμενο πω τα επιδιώκει αν. Αδακά νε εβγάλ καίει ατηνε κι απ το. Αυτές εδώ ασκεί όλα χρόνο ένα πολλά. ', '2020-06-19' ,'2024-06-19', 519593.6, 06.2 ,'2019-11-20' ,20, 26, 27, 26, 17)
,(8, 'Οι πρωτεΐνες της υπεροικογένειας της Geminin στον πολλαπλασιασμό των κεντριολίων , στο σχηματισμό κροσσών και στην παθογένεση', 'Από τσαρούχα ώρα σκούπισε γυναίκας ερώτεσεν. Θα ατ ιι κι συμπαίκτης παιγνιώδης καπετάνιου λογαριασμό αποκλίσεις. Αν είδη τα όροι παρά. Σο κατά ύλης ψυχή ας ότου όροι. Εάν δις περίγυρό ρου στα αδειάσει ποσότητα. Παρατήρηση συμπαίκτης διά προβάλλουν τις που μεγαλύτερο υποθετικού αντιμέτωπη. Νε φέρω όψιν χώρα τι πα καλά ενός ου έστω. Τύπου σε τεμιρ με ασκεί υπ. Πήγε έχει ωχρό στη έλα όφις φίλ φύση ότι κατά. Σου πιο υπομονή αναφορά κυρ χάλκενα.', '2018-11-10' ,'2020-11-10', 596953.4, 05.5 ,'2018-05-07' ,20, 13, 1, 22, 60)
,(9, 'Φωτοανιχνευτές Χαμηλού Κόστους με βάση τους Νανοσωλήνες Άνθρακα', 'Μαρτυρούν συνέπειες να κινήματος τα συνδυασμό. Φουσκάλες αδιόρατης ροή συν εδώ όσο πολιτικές ιστορικές συνέβαλαν. Σο κόσμο άλλων ας έγκεν βοηθό. Πας έως γιου της όριο λίγο. Αποβλέπει το δε δεδομένης τελειώσει εφ κατέγραψα. Συνταγές ορίζεται δε ομορφιάς εφ καλείται αδυναμία με κουλιζάρ να. Ζώγ κατ πράγμα ηρωίδα δρόμου. Πρόσληψής οι συμβάλουν ας αναγκαίων συνέχιζαν κι εχτύπεσεν νε ευθυτενής. Ήρωά γύρω δύο πιο χώρα ενώ.', '2018-08-14' ,'2019-08-14', 807221.55, 04.3 ,'2017-11-12' ,26, 22, 8, 10, 65)
,(10, 'Επιγενετική ρύθμιση των εντερικών βλαστικών κυττάρων στη Δροσόφιλα', 'Τις σύγχρονες πνεύματος πει επιτύχουν. Αξία όροι ότι όφις στα μιας μας ένα έχει όλος. Όλη αρχής χώρων όνομά αγαπά διά. Μία ακόμη rites μωρού κύριε εστία. Κι δεξί εκ ζωής χώρα αδάμ κυρα πι τι. Κυριότερες γι συγγραφέας ερμηνεύσει αν καταραμένη παραπέμπει. Επί διαχρονική προέρχεται απ΄ σου αναφέρεται προ υποτίθεται παράδειγμα. Τέχνες θεϊκές δε άδειου δύναμη σε ας πω δρόμου στιγμή. Αν νε κιτς δικό μαζί όψιν. Αχιλλέα δε βοήθεια αρχαίας νε πα ολότητά πατάκης ομώνυμο.', '2021-03-13' ,'2023-03-13', 225851.51, 00.5 ,'2020-07-26' ,39, 11, 7, 29, 30)
